import React, { Component } from "react";
import "./style.css";
class SignIn extends Component {
  constructor() {
    super();
    this.state = {
      userName: "",
      country: "",
      email: "",
      password: "",
    };
  }

  handelUserName = (event) => {
    this.setState({ userName: event.target.value });
  };

  handelCountry = (event) => {
    this.setState({ country: event.target.value });
  };

  handelEmail = (event) => {
    this.setState({ email: event.target.value });
  };

  handlePassword = (event) => {
    this.setState({ password: event.target.value });
  };
  SignUp = () => {
    this.props.SignUp(
      this.state.userName,
      this.state.country,
      this.state.email,
      this.state.password
    );
  };
  render() {
    return (
      <div>
        <table>
          <tr>
            <td>userName </td>
            <td>
              <input
                required
                type="text"
                onChange={this.handelUserName}
              ></input>
            </td>
          </tr>
          <tr>
            <td>Country </td>
            <td>
              <input required type="text" onChange={this.handelCountry}></input>
            </td>
          </tr>
          <tr>
            <td>Email </td>
            <td>
              <input required type="text" onChange={this.handelEmail}></input>
            </td>
          </tr>
          <tr>
            <td>Password </td>
            <td>
              <input
                requiredtype="password"
                onChange={this.handlePassword}
              ></input>
            </td>
          </tr>
          <tr>
            <td>
              <button onClick={this.SignUp}>sign up</button>
            </td>
          </tr>
        </table>
      </div>
    );
  }
}
export default SignIn;
